emen":"AC33D64_map","Zambia":"DCF25ED_map","Zimbabwe":"5922F5C_map"},"path":"../site/plots/data/","rel_path":"./data/"},"mpoly":{"id":"1133"},"p_graph":{"id":"1003"},"p_map":{"id":"1086"},"source_graph":{"id":"1001"},"source_map":{"id":"1002"}},"code":"// CustomJS: Tap callback for the state map\n//\n// Provided arguments:\n// args={      'event':ev,\n//             'mpoly':mpoly,\n//             'ext_datafiles': ext_datafiles,\n//             'source_map': source_map,\n//             'p_map':p_map,\n// ),\n// Interprete and respond\nvar ind = mpoly.data_source.selected.indices\nvar location = 'None'\nvar filename_data = ''\nvar filename_map = ''\nvar hash = ''\n// Get other models/tooltips\nconst button_continental_us_only = window.Bokeh.documents[0].get_model_by_name('button_continental_us_only')\nconst radioGroup_level_select = window.Bokeh.documents[0].get_model_by_name('radioGroup_level_select')\nconst span_play_position = window.Bokeh.documents[0].get_model_by_name('span_play_position')\nconst date_range_slider = window.Bokeh.documents[0].get_model_by_name('date_range_slider')\nconst spinner_minStepTime = window.Bokeh.documents[0].get_model_by_name('spinner_minStepTime')\nconst radioGroup_play_controls = window.Bokeh.documents[0].get_model_by_name('radioGroup_play_controls')\nconst play_controls = {\n  'play': 0,\n  'step': 1,\n  'pause': 2,\n}\n\nswitch (event) {\n  case 'graph_tap':\n    // Find nearest date in data and its index\n    var near_date = find_in_sorted_array(cb_obj.x, source_graph.data['date'])\n    var day = new Date(near_date['value'])\n    var sval = date_range_slider.value;\n    date_range_slider.value = [day.getTime(), sval[1]];\n    break;\n\n  case 'button_continental_us_only':\n    if (button_continental_us_only.active) {\n      radioGroup_level_select.active = 1;\n      var data = source_map.data;\n      var new_data = {};\n      for (var key in data) {\n        new_data[key] = data[key];\n      }\n\n      for (var i = 0; i &lt; new_data['location'].length; i++) {\n        if (continental_states.includes(new_data['location'][i])) {\n          // do nothing\n        } else {\n          // remove non-continental state\n          for (var key in new_data) {\n            new_data[key].splice(i, 1)\n          }\n        }\n      }\n      source_map.data = new_data;\n      source_map.change.emit();\n    }\n\n    break;\n\n  case 'level_select':\n    switch (radioGroup_level_select.active) { // 0 world, 1 states, 2 counties\n      case 0:\n        location = 'Earth'\n        p_map.x_range.names = [];\n        p_map.reset.emit();\n        break;\n      case 1:\n        location = 'US';\n        break;\n      case 2:\n        if (ind.length &gt; 0) {\n          location = mpoly.data_source.data['location'][ind[0]]\n          if (location.endsWith(', US')) {\n            p_map.x_range.names = [];\n            p_map.reset.emit();\n          } else {\n            location = '';\n          }\n        } else {\n          location = '';\n        }\n        if (location.length &lt; 1) {\n          alert('First Select a State On The Map')\n          this.active = 1;\n        }\n        break;\n    }\n\n    if (location.length &gt; 0) {\n      //console.log(location + ' selected')\n      if (location in ext_datafiles['location_to_mapfilename']) {\n        filename_map = ext_datafiles['location_to_mapfilename'][location] + '.json.gz'\n        //console.log(filename_map)\n        //console.log(ext_datafiles['rel_path'] + filename_map)\n        readJSONgz_fun(ext_datafiles['rel_path'] + filename_map, function() {\n          var data = JSON.parse(pako.inflate(this.response, {\n            to: 'string'\n          }));\n          //console.log('Mapfile read:')\n          //console.log(data)\n          if (data['data']['x'].length &lt; 1) {\n            //Map is empty\n          } else {\n            // Map is provided\n            mpoly.data_source.data = data['data']\n            // Show the right date in the title\n            var day = new Date(data['data']['latestDate'][0] / 1e6);\n            const date_format_options = {\n              year: 'numeric',\n              month: 'short',\n              day: 'numeric',\n              timeZone: 'UTC'\n            };\n            const date_format_options2 = {\n              weekday: 'long',\n              timeZone: 'UTC'\n            };\n            // Including UTC as the timezone is important\n            var day_str = day.toLocaleDateString(\"en-US\", date_format_options) + \", \" + day.toLocaleDateString(\"en-US\", date_format_options2)\n            p_map.title.text = day_str;\n\n            mpoly.data_source.change.emit()\n\n            if (location == 'US') {\n              if (button_continental_us_only.active) {\n                button_continental_us_only.active = false;\n                button_continental_us_only.active = true;\n              }\n            }\n          }\n        })\n      }\n    }\n    break;\n\n\n  case 'date_range_slider':\n    var start_date = new Date(date_range_slider.value[0])\n    var end_date = new Date(date_range_slider.value[1])\n    var day = start_date;\n    span_play_position.location = day.getTime();\n\n    switch (radioGroup_play_controls.active) {\n      case play_controls.step:\n        radioGroup_play_controls.active = play_controls.pause;\n        break;\n      case play_controls.play:\n      case play_controls.pause:\n        break;\n    }\n\n    // No break from date_range_slider, directly into radioGroup_play_controls\n    case 'radioGroup_play_controls':\n      switch (radioGroup_play_controls.active) {\n        case play_controls.pause:\n          date_range_slider.disabled = false;\n          break;\n        case play_controls.step:\n        case play_controls.play:\n          date_range_slider.disabled = true;\n          var start_date = new Date(date_range_slider.value[0])\n          var end_date = new Date(date_range_slider.value[1])\n          var day = start_date;\n\n          var date_format_options = {\n            year: 'numeric',\n            month: 'short',\n            day: 'numeric',\n            timeZone: 'UTC'\n          };\n          var date_format_options2 = {\n            weekday: 'long',\n            timeZone: 'UTC'\n          };\n          // Including UTC as the timezone is important\n          var day_str = day.toLocaleDateString(\"en-US\", date_format_options) + \", \" + day.toLocaleDateString(\"en-US\", date_format_options2)\n\n          var next_day = new Date(day)\n          next_day.setDate(next_day.getDate() + 1)\n\n\n          // Find all locations on the map\n          var locations = mpoly.data_source.data['location']\n          var cnt = 0\n          var t0 = performance.now()\n          // Load data for each location, and update the map with the data for the given date\n          for (const [n, loc] of locations.entries()) {\n            readJSONgz_fun(ext_datafiles['rel_path'] + ext_datafiles['location_to_filename'][loc] + '.json.gz', function() {\n              var data = JSON.parse(pako.inflate(this.response, {\n                to: 'string'\n              }));\n              data['data'] = rep_nan_code(data['data'], data['nan_code'])\n              data['data'] = correct_date_format(data['data'])\n\n              const sel_date = find_in_sorted_array(day.getTime(), data['data']['date'])\n\n              // Update the map data with the data for the selected date\n              for (const k in mpoly.data_source.data) {\n                if (k in data['data']) {\n                  mpoly.data_source.data[k][n] = data['data'][k][sel_date['index']]\n                }\n              }\n\n              cnt += 1\n              if (cnt &gt;= locations.length) {\n                // Finished updating map, set map title\n                p_map.title.text = day_str;\n                mpoly.data_source.change.emit()\n\n                // Finish up step and ready for next, when minimum time elapsed\n                var dt = performance.now() - t0\n                setTimeout(function() {\n                  // Update DateRangeSlider and play controls\n                  if (next_day.getTime() &gt; end_date.getTime()) {\n                    date_range_slider.value = [end_date.getTime(), end_date.getTime()];\n                    radioGroup_play_controls.active = play_controls.pause;\n                  } else {\n                    date_range_slider.value = [next_day.getTime(), end_date.getTime()];\n                  }\n                  date_range_slider.change.emit()\n\n                  switch (radioGroup_play_controls.active) {\n                    case play_controls.step:\n                      // if stepping, then goto pause which will trigger enabling the DateRangeSlider\n                      radioGroup_play_controls = play_controls.pause;\n                      break;\n                  }\n                }, spinner_minStepTime.value*1000 - dt);\n              }\n            }, 10000)\n          }\n          break;\n      }\n      break;\n}\n\n\n// ----------------------------------------\n// Support Functions:\n// ----------------------------------------\n\n\n// Find nearest value and index\nfunction find_in_sorted_array(x, sorted_array) {\n  var i = 0;\n  while (x &gt; sorted_array[i] &amp; i &lt; sorted_array.length - 1) {\n    i += 1\n  }\n  return {\n    'value': sorted_array[i],\n    'index': i\n  }\n}\n\n// Replace nan with nan_code in a dictionary of arrays\nfunction rep_nan_code(dic, nan_code) {\n  var inds\n  for (var key in dic) {\n    if (Array.isArray(dic[key])) {\n      dic[key] = array_element_replace(dic[key], nan_code, NaN)\n    }\n  }\n  return dic;\n}\n\n// Replace old_value with new_value in an array\nfunction array_element_replace(arr, old_value, new_value) {\n  for (var i = 0; i &lt; arr.length; i++) {\n    if (Array.isArray(arr[i])) {\n      if (arr[i].length &gt; 1) {\n        arr[i] = array_element_replace(arr[i], old_value, new_value)\n      } else {\n / remove non-continental state\n          for (var key in new_data) {\n            new_data[key].splice(i, 1)\n          }\n        }\n      }\n      source_map.data = new_data;\n      source_map.change.emit();\n    }\n\n    break;\n\n  case 'level_select':\n    switch (radioGroup_level_select.active) { // 0 world, 1 states, 2 counties\n      case 0:\n        location = 'Earth'\n        p_map.x_range.names = [];\n        p_map.reset.emit();\n        break;\n      case 1:\n        location = 'US';\n        break;\n      case 2:\n        if (ind.length &gt; 0) {\n          location = mpoly.data_source.data['location'][ind[0]]\n          if (location.endsWith(', US')) {\n            p_map.x_range.names = [];\n            p_map.reset.emit();\n          } else {\n            location = '';\n          }\n        } else {\n          location = '';\n        }\n        if (location.length &lt; 1) {\n          alert('First Select a State On The Map')\n          this.active = 1;\n        }\n        break;\n    }\n\n    if (location.length &gt; 0) {\n      //console.log(location + ' selected')\n      if (location in ext_datafiles['location_to_mapfilename']) {\n        filename_map = ext_datafiles['location_to_mapfilename'][location] + '.json.gz'\n        //console.log(filename_map)\n        //console.log(ext_datafiles['rel_path'] + filename_map)\n        readJSONgz_fun(ext_datafiles['rel_path'] + filename_map, function() {\n          var data = JSON.parse(pako.inflate(this.response, {\n            to: 'string'\n          }));\n          //console.log('Mapfile read:')\n          //console.log(data)\n          if (data['data']['x'].length &lt; 1) {\n            //Map is empty\n          } else {\n            // Map is provided\n            mpoly.data_source.data = data['data']\n            // Show the right date in the title\n            var day = new Date(data['data']['latestDate'][0] / 1e6);\n            const date_format_options = {\n              year: 'numeric',\n              month: 'short',\n              day: 'numeric',\n              timeZone: 'UTC'\n            };\n            const date_format_options2 = {\n              weekday: 'long',\n              timeZone: 'UTC'\n            };\n            // Including UTC as the timezone is important\n            var day_str = day.toLocaleDateString(\"en-US\", date_format_options) + \", \" + day.toLocaleDateString(\"en-US\", date_format_options2)\n            p_map.title.text = day_str;\n\n            mpoly.data_source.change.emit()\n\n            if (location == 'US') {\n              if (button_continental_us_only.active) {\n                button_continental_us_only.active = false;\n                button_continental_us_only.active = true;\n              }\n            }\n          }\n        })\n      }\n    }\n    break;\n\n\n  case 'date_range_slider':\n    var start_date = new Date(date_range_slider.value[0])\n    var end_date = new Date(date_range_slider.value[1])\n    var day = start_date;\n    span_play_position.location = day.getTime();\n\n    switch (radioGroup_play_controls.active) {\n      case play_controls.step:\n        radioGroup_play_controls.active = play_controls.pause;\n        break;\n      case play_controls.play:\n      case play_controls.pause:\n        break;\n    }\n\n    // No break from date_range_slider, directly into radioGroup_play_controls\n    case 'radioGroup_play_controls':\n      switch (radioGroup_play_controls.active) {\n        case play_controls.pause:\n          date_range_slider.disabled = false;\n          break;\n        case play_controls.step:\n        case play_controls.play:\n          date_range_slider.disabled = true;\n          var start_date = new Date(date_range_slider.value[0])\n          var end_date = new Date(date_range_slider.value[1])\n          var day = start_date;\n\n          var date_format_options = {\n            year: 'numeric',\n            month: 'short',\n            day: 'numeric',\n            timeZone: 'UTC'\n          };\n          var date_format_options2 = {\n            weekday: 'long',\n            timeZone: 'UTC'\n          };\n          // Including UTC as the timezone is important\n          var day_str = day.toLocaleDateString(\"en-US\", date_format_options) + \", \" + day.toLocaleDateString(\"en-US\", date_format_options2)\n\n          var next_day = new Date(day)\n          next_day.setDate(next_day.getDate() + 1)\n\n\n          // Find all locations on the map\n          var locations = mpoly.data_source.data['location']\n          var cnt = 0\n          var t0 = performance.now()\n          // Load data for each location, and update the map with the data for the given date\n          for (const [n, loc] of locations.entries()) {\n            readJSONgz_fun(ext_datafiles['rel_path'] + ext_datafiles['location_to_filename'][loc] + '.json.gz', function() {\n              var data = JSON.parse(pako.inflate(this.response, {\n                to: 'string'\n              }));\n              data['data'] = rep_nan_code(data['data'], data['nan_code'])\n              data['data'] = correct_date_format(data['data'])\n\n              const sel_date = find_in_sorted_array(day.getTime(), data['data']['date'])\n\n              // Update the map data with the data for the selected date\n              for (const k in mpoly.data_source.data) {\n                if (k in data['data']) {\n                  mpoly.data_source.data[k][n] = data['data'][k][sel_date['index']]\n                }\n              }\n\n              cnt += 1\n              if (cnt &gt;= locations.length) {\n                // Finished updating map, set map title\n                p_map.title.text = day_str;\n                mpoly.data_source.change.emit()\n\n                // Finish up step and ready for next, when minimum time elapsed\n                var dt = performance.now() - t0\n                setTimeout(function() {\n                  // Update DateRangeSlider and play controls\n                  if (next_day.getTime() &gt; end_date.getTime()) {\n                    date_range_slider.value = [end_date.getTime(), end_date.getTime()];\n                    radioGroup_play_controls.active = play_controls.pause;\n                  } else {\n                    date_range_slider.value = [next_day.getTime(), end_date.getTime()];\n                  }\n                  date_range_slider.change.emit()\n\n                  switch (radioGroup_play_controls.active) {\n                    case play_controls.step:\n                      // if stepping, then goto pause which will trigger enabling the DateRangeSlider\n                      radioGroup_play_controls = play_controls.pause;\n                      break;\n                  }\n                }, spinner_minStepTime.value*1000 - dt);\n              }\n            }, 10000)\n          }\n          break;\n      }\n      break;\n}\n\n\n// ----------------------------------------\n// Support Functions:\n// ----------------------------------------\n\n\n// Find nearest value and index\nfunction find_in_sorted_array(x, sorted_array) {\n  var i = 0;\n  while (x &gt; sorted_array[i] &amp; i &lt; sorted_array.length - 1) {\n    i += 1\n  }\n  return {\n    'value': sorted_array[i],\n    'index': i\n  }\n}\n\n// Replace nan with nan_code in a dictionary of arrays\nfunction rep_nan_code(dic, nan_code) {\n  var inds\n  for (var key in dic) {\n    if (Array.isArray(dic[key])) {\n      dic[key] = array_element_replace(dic[key], nan_code, NaN)\n    }\n  }\n  return dic;\n}\n\n// Replace old_value with new_value in an array\nfunction array_element_replace(arr, old_value, new_value) {\n  for (var i = 0; i &lt; arr.length; i++) {\n    if (Array.isArray(arr[i])) {\n      if (arr[i].length &gt; 1) {\n        arr[i] = array_element_replace(arr[i], old_value, new_value)\n      } else {\n        if (arr[i] === old_value) {\n          arr[i] = new_value;\n        }\n      }\n    } else {\n      if (arr[i] === old_value) {\n        arr[i] = new_value;\n      }\n    }\n  }\n  return arr;\n}\n\nfunction correct_date_format(dic, key = 'date') {\n  const mul = 1e-6\n  dic[key] = dic[key].map(function(a) {\n    return a * mul;\n  })\n  return dic\n}\n\n// Reading gzip json data\nfunction readJSONgz_fun(file, fun_onload, timeout = 2000) {\n  // Based on https://developer.mozilla.org/en-US/docs/Web/API/XMLHttpRequest/Synchronous_and_Asynchronous_Requests\n  var data;\n  var request = new XMLHttpRequest();\n  request.responseType = 'arraybuffer';\n  request.ontimeout = function() {\n    console.error(\"The request for \" + file + \" timed out.\");\n  };\n  request.timeout = timeout;\n  request.onload = fun_onload;\n  request.open('GET', file);\n  request.send();\n\n\n  return request;\n}\n"},"id":"1160","type":"CustomJS"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1209","type":"MonthsTicker"},{"attributes":{"js_property_callbacks":{"change:value":[{"id":"1162"}]},"options":["commercialScore","death","deathConfirmed","deathIncrease","deathIncreaseMAV10","deathIncreaseMAV10PerMil","deathIncreasePerMil","deathPerMil","deathProbable","fips","grade","hospitalized","hospitalizedCumulative","hospitalizedCurrently","hospitalizedIncrease","inIcuCumulative","inIcuCurrently","negative","negativeIncrease","negativeRegularScore","negativeScore","negativeTestsAntibody","negativeTestsPeopleAntibody","negativeTestsViral","onVentilatorCumulative","onVentilatorCurrently","pending","posNeg","positive","positiveActive","positiveActiveIncrease","positiveActiveIncreaseMAV","positiveActiveIncreaseMAVPerMil","positiveActiveIncreasePerMil","positiveActivePerMil","positiveCasesViral","positiveIncrease","positiveIncreaseMAV","positiveIncreaseMAVPerMil","positiveIncreasePerMil","positivePerMil","positiveScore","positiveTestsAntibody","positiveTestsAntigen","positiveTestsPeopleAntibody","positiveTestsPeopleAntigen","positiveTestsViral","probableCases","recovered","recoveredIncrease","recoveredIncreaseMAV","recoveredIncreaseMAVPerMil","reco source_map': source_map,\n//             'p_map':p_map,\n// ),\n// Interprete and respond\nvar ind = mpoly.data_source.selected.indices\nvar location = 'None'\nvar filename_data = ''\nvar filename_map = ''\nvar hash = ''\n// Get other models/tooltips\nconst button_continental_us_only = window.Bokeh.documents[0].get_model_by_name('button_continental_us_only')\nconst radioGroup_level_select = window.Bokeh.documents[0].get_model_by_name('radioGroup_level_select')\nconst span_play_position = window.Bokeh.documents[0].get_model_by_name('span_play_position')\nconst date_range_slider = window.Bokeh.documents[0].get_model_by_name('date_range_slider')\nconst spinner_minStepTime = window.Bokeh.documents[0].get_model_by_name('spinner_minStepTime')\nconst radioGroup_play_controls = window.Bokeh.documents[0].get_model_by_name('radioGroup_play_controls')\nconst play_controls = {\n  'play': 0,\n  'step': 1,\n  'pause': 2,\n}\n\nswitch (event) {\n  case 'graph_tap':\n    // Find nearest date in data and its index\n    var near_date = find_in_sorted_array(cb_obj.x, source_graph.data['date'])\n    var day = new Date(near_date['value'])\n    var sval = date_range_slider.value;\n    date_range_slider.value = [day.getTime(), sval[1]];\n    break;\n\n  case 'button_continental_us_only':\n    if (button_continental_us_only.active) {\n      radioGroup_level_select.active = 1;\n      var data = source_map.data;\n      var new_data = {};\n      for (var key in data) {\n        new_data[key] = data[key];\n      }\n\n      for (var i = 0; i &lt; new_data['location'].length; i++) {\n        if (continental_states.includes(new_data['location'][i])) {\n          // do nothing\n        } else {\n          // remove non-continental state\n          for (var key in new_data) {\n            new_data[key].splice(i, 1)\n          }\n        }\n      }\n      source_map.data = new_data;\n      source_map.change.emit();\n    }\n\n    break;\n\n  case 'level_select':\n    switch (radioGroup_level_select.active) { // 0 world, 1 states, 2 counties\n      case 0:\n        location = 'Earth'\n        p_map.x_range.names = [];\n        p_map.reset.emit();\n        break;\n      case 1:\n        location = 'US';\n        break;\n      case 2:\n        if (ind.length &gt; 0) {\n          location = mpoly.data_source.data['location'][ind[0]]\n          if (location.endsWith(', US')) {\n            p_map.x_range.names = [];\n            p_map.reset.emit();\n          } else {\n            location = '';\n          }\n        } else {\n          location = '';\n        }\n        if (location.length &lt; 1) {\n          alert('First Select a State On The Map')\n          this.active = 1;\n        }\n        break;\n    }\n\n    if (location.length &gt; 0) {\n      //console.log(location + ' selected')\n      if (location in ext_datafiles['location_to_mapfilename']) {\n        filename_map = ext_datafiles['location_to_mapfilename'][location] + '.json.gz'\n        //console.log(filename_map)\n        //console.log(ext_datafiles['rel_path'] + filename_map)\n        readJSONgz_fun(ext_datafiles['rel_path'] + filename_map, function() {\n          var data = JSON.parse(pako.inflate(this.response, {\n            to: 'string'\n          }));\n          //console.log('Mapfile read:')\n          //console.log(data)\n          if (data['data']['x'].length &lt; 1) {\n            //Map is empty\n          } else {\n            // Map is provided\n            mpoly.data_source.data = data['data']\n            // Show the right date in the title\n            var day = new Date(data['data']['latestDate'][0] / 1e6);\n            const date_format_options = {\n              year: 'numeric',\n              month: 'short',\n              day: 'numeric',\n              timeZone: 'UTC'\n            };\n            const date_format_options2 = {\n              weekday: 'long',\n              timeZone: 'UTC'\n            };\n            // Including UTC as the timezone is important\n            var day_str = day.toLocaleDateString(\"en-US\", date_format_options) + \", \" + day.toLocaleDateString(\"en-US\", date_format_options2)\n            p_map.title.text = day_str;\n\n            mpoly.data_source.change.emit()\n\n            if (location == 'US') {\n              if (button_continental_us_only.active) {\n                button_continental_us_only.active = false;\n                button_continental_us_only.active = true;\n              }\n            }\n          }\n        })\n      }\n    }\n    break;\n\n\n  case 'date_range_slider':\n    var start_date = new Date(date_range_slider.value[0])\n    var end_date = new Date(date_range_slider.value[1])\n    var day = start_date;\n    span_play_position.location = day.getTime();\n\n    switch (radioGroup_play_controls.active) {\n      case play_controls.step:\n        radioGroup_play_controls.active = play_controls.pause;\n        break;\n      case play_controls.play:\n      case play_controls.pause:\n        break;\n    }\n\n    // No break from date_range_slider, directly into radioGroup_play_controls\n    case 'radioGroup_play_controls':\n      switch (radioGroup_play_controls.active) {\n        case play_controls.pause:\n          date_range_slider.disabled = false;\n          break;\n        case play_controls.step:\n        case play_controls.play:\n          date_range_slider.disabled = true;\n          var start_date = new Date(date_range_slider.value[0])\n          var end_date = new Date(date_range_slider.value[1])\n          var day = start_date;\n\n          var date_format_options = {\n            year: 'numeric',\n            month: 'short',\n            day: 'numeric',\n            timeZone: 'UTC'\n          };\n          var date_format_options2 = {\n            weekday: 'long',\n            timeZone: 'UTC'\n          };\n          // Including UTC as the timezone is important\n          var day_str = day.toLocaleDateString(\"en-US\", date_format_options) + \", \" + day.toLocaleDateString(\"en-US\", date_format_options2)\n\n          var next_day = new Date(day)\n          next_day.setDate(next_day.getDate() + 1)\n\n\n          // Find all locations on the map\n          var locations = mpoly.data_source.data['location']\n          var cnt = 0\n          var t0 = performance.now()\n          // Load data for each location, and update the map with the data for the given date\n          for (const [n, loc] of locations.entries()) {\n            readJSONgz_fun(ext_datafiles['rel_path'] + ext_datafiles['location_to_filename'][loc] + '.json.gz', function() {\n              var data = JSON.parse(pako.inflate(this.response, {\n                to: 'string'\n              }));\n              data['data'] = rep_nan_code(data['data'], data['nan_code'])\n              data['data'] = correct_date_format(data['data'])\n\n              const sel_date = find_in_sorted_array(day.getTime(), data['data']['date'])\n\n              // Update the map data with the data for the selected date\n              for (const k in mpoly.data_source.data) {\n                if (k in data['data']) {\n                  mpoly.data_source.data[k][n] = data['data'][k][sel_date['index']]\n                }\n              }\n\n              cnt += 1\n              if (cnt &gt;= locations.length) {\n                // Finished updating map, set map title\n                p_map.title.text = day_str;\n                mpoly.data_source.change.emit()\n\n                // Finish up step and ready for next, when minimum time elapsed\n                var dt = performance.now() - t0\n                setTimeout(function() {\n                  // Update DateRangeSlider and play controls\n                  if (next_day.getTime() &gt; end_date.getTime()) {\n                    date_range_slider.value = [end_date.getTime(), end_date.getTime()];\n                    radioGroup_play_controls.active = play_controls.pause;\n                  } else {\n                    date_range_slider.value = [next_day.getTime(), end_date.getTime()];\n                  }\n                  date_range_slider.change.emit()\n\n                  switch (radioGroup_play_controls.active) {\n                    case play_controls.step:\n                      // if stepping, then goto pause which will trigger enabling the DateRangeSlider\n                      radioGroup_play_controls = play_controls.pause;\n                      break;\n                  }\n                }, spinner_minStepTime.value*1000 - dt);\n              }\n            }, 10000)\n          }\n          break;\n      }\n      break;\n}\n\n\n// ----------------------------------------\n// Support Functions:\n// ----------------------------------------\n\n\n// Find nearest value and index\nfunction find_in_sorted_array(x, sorted_array) {\n  var i = 0;\n  while (x &gt; sorted_array[i] &amp; i &lt; sorted_array.length - 1) {\n    i += 1\n  }\n  return {\n    'value': sorted_array[i],\n    'index': i\n  }\n}\n\n// Replace nan with nan_code in a dictionary of arrays\nfunction rep_nan_code(dic, nan_code) {\n  var inds\n  for (var key in dic) {\n    if (Array.isArray(dic[key])) {\n      dic[key] = array_element_replace(dic[key], nan_code, NaN)\n    }\n  }\n  return dic;\n}\n\n// Replace old_value with new_value in an array\nfunction array_element_replace(arr, old_value, new_value) {\n  for (var i = 0; i &lt; arr.length; i++) {\n    if (Array.isArray(arr[i])) {\n      if (arr[i].length &gt; 1) {\n        arr[i] = array_element_replace(arr[i], old_value, new_value)\n      } else {\n        if (arr[i] === old_value) {\n          arr[i] = new_value;\n        }\n      }\n    } else {\n      if (arr[i] === old_value) {\n        arr[i] = new_value;\n      }\n    }\n  }\n  return arr;\n}\n\nfunction correct_date_format(dic, key = 'date') {\n  const mul = 1e-6\n  dic[key] = dic[key].map(function(a) {\n    return a * mul;\n  })\n  return dic\n}\n\n// Reading gzip json data\nfunction readJSONgz_fun(file, fun_onload, timeout = 2000) {\n  // Based on https://developer.mozilla.org/en-US/docs/Web/API/XMLHttpRequest/Synchronous_and_Asynchronous_Requests\n  var data;\n  var request = new XMLHttpRequest();\n  request.responseType = 'arraybuffer';\n  request.ontimeout = function() {\n    console.error(\"The request for \" + file + \" timed out.\");\n  };\n  request.timeout = timeout;\n  request.onload = fun_onload;\n  request.open('GET', file);\n  request.send();\n\n\n  return request;\n}\n"},"id":"1153","type":"CustomJS"},{"attributes":{"callback":{"id":"1137"}},"id":"1113","type":"TapTool"},{"attributes":{"formatter":{"id":"1057"},"ticker":{"id":"1019"}},"id":"1018","type":"LinearAxis"},{"attributes":{},"id":"1139","type":"BasicTickFormatter"},{"attributes":{},"id":"1114","type":"PanTool"},{"attributes":{"match_aspect":true,"overlay":{"id":"1141"}},"id":"1124","type":"BoxZoomTool"},{"attributes":{"dimension":"height","line_alpha":0.5,"line_color":"gray","line_dash":[6],"line_width":2,"location":1592611200000.0},"id":"1060","type":"Span"},{"attributes":{},"id":"1019","type":"BasicTicker"},{"attributes":{},"id":"1115","type":"WheelZoomTool"},{"attributes":{"axis":{"id":"1018"},"dimension":1,"ticker":null},"id":"1021","type":"Grid"},{"attributes":{"dimension":"height","line_alpha":0.5,"line_color":"gray","line_dash":[6],"line_width":2,"location":1593216000000.0},"id":"1061","type":"Span"},{"attributes":{},"id":"1116","type":"ResetTool"},{"attributes":{"dimension":"height","line_alpha":0.5,"line_color":"gray","line_dash":[6],"line_width":2,"location":1593820800000.0},"id":"1062","type":"Span"},{"attributes":{"dimension":"height","line_alpha":0.5,"line_color":"gray","line_dash":[6],"line_width":2,"location":1594425600000.0},"id":"1063","type":"Span"},{"attributes":{"dimension":"height","line_alpha":0.5,"line_color":"gray","line_dash":[6],"line_width":2,"location":1595030400000.0},"id":"1064","type":"Span"},{"attributes":{},"id":"1117","type":"SaveTool"},{"attributes":{"format":"0,0.0"},"id":"1057","type":"Nu ":"A2B7C12_map","Timor-Leste":"2D79F6D_map","Togo":"30949D5_map","Trinidad and Tobago":"4D206A8_map","Tunisia":"EDF404D_map","Turkey":"D7153E6_map","US":"AA30935_map","Uganda":"E92904B_map","Ukraine":"C951EC0_map","United Arab Emirates":"D115B8D_map","United Kingdom":"9769121_map","Uruguay":"66B9892_map","Utah, US":"CADDD2F_map","Uzbekistan":"DB800E8_map","Venezuela":"9D4AC43_map","Vermont, US":"7BCA361_map","Vietnam":"681101D_map","Virginia, US":"588CE0A_map","Washington, US":"4961CBB_map","West Bank and Gaza":"A0F1B40_map","West Virginia, US":"6A22BCB_map","Western Sahara":"FAB1A52_map","Wisconsin, US":"69636F7_map","Wyoming, US":"0FDE12C_map","Yemen":"AC33D64_map","Zambia":"DCF25ED_map","Zimbabwe":"5922F5C_map"},"path":"../site/plots/data/","rel_path":"./data/"},"mpoly":{"id":"1133"},"p_map":{"id":"1086"},"source_map":{"id":"1002"}},"code":"// CustomJS: Tap callback for the state map\n//\n// Provided arguments:\n// args={      'event':ev,\n//             'mpoly':mpoly,\n//             'ext_datafiles': ext_datafiles,\n//             'source_map': source_map,\n//             'p_map':p_map,\n// ),\n// Interprete and respond\nvar ind = mpoly.data_source.selected.indices\nvar location = 'None'\nvar filename_data = ''\nvar filename_map = ''\nvar hash = ''\n// Get other models/tooltips\nconst button_continental_us_only = window.Bokeh.documents[0].get_model_by_name('button_continental_us_only')\nconst radioGroup_level_select = window.Bokeh.documents[0].get_model_by_name('radioGroup_level_select')\nconst span_play_position = window.Bokeh.documents[0].get_model_by_name('span_play_position')\nconst date_range_slider = window.Bokeh.documents[0].get_model_by_name('date_range_slider')\nconst spinner_minStepTime = window.Bokeh.documents[0].get_model_by_name('spinner_minStepTime')\nconst radioGroup_play_controls = window.Bokeh.documents[0].get_model_by_name('radioGroup_play_controls')\nconst play_controls = {\n  'play': 0,\n  'step': 1,\n  'pause': 2,\n}\n\nswitch (event) {\n  case 'graph_tap':\n    // Find nearest date in data and its index\n    var near_date = find_in_sorted_array(cb_obj.x, source_graph.data['date'])\n    var day = new Date(near_date['value'])\n    var sval = date_range_slider.value;\n    date_range_slider.value = [day.getTime(), sval[1]];\n    break;\n\n  case 'button_continental_us_only':\n    if (button_continental_us_only.active) {\n      radioGroup_level_select.active = 1;\n      var data = source_map.data;\n      var new_data = {};\n      for (var key in data) {\n        new_data[key] = data[key];\n      }\n\n      for (var i = 0; i &lt; new_data['location'].length; i++) {\n        if (continental_states.includes(new_data['location'][i])) {\n          // do nothing\n        } else {\n          // remove non-continental state\n          for (var key in new_data) {\n            new_data[key].splice(i, 1)\n          }\n        }\n      }\n      source_map.data = new_data;\n      source_map.change.emit();\n    }\n\n    break;\n\n  case 'level_select':\n    switch (radioGroup_level_select.active) { // 0 world, 1 states, 2 counties\n      case 0:\n        location = 'Earth'\n        p_map.x_range.names = [];\n        p_map.reset.emit();\n        break;\n      case 1:\n        location = 'US';\n        break;\n      case 2:\n        if (ind.length &gt; 0) {\n          location = mpoly.data_source.data['location'][ind[0]]\n          if (location.endsWith(', US')) {\n            p_map.x_range.names = [];\n            p_map.reset.emit();\n          } else {\n            location = '';\n          }\n        } else {\n          location = '';\n        }\n        if (location.length &lt; 1) {\n          alert('First Select a State On The Map')\n          this.active = 1;\n        }\n        break;\n    }\n\n    if (location.length &gt; 0) {\n      //console.log(location + ' selected')\n      if (location in ext_datafiles['location_to_mapfilename']) {\n        filename_map = ext_datafiles['location_to_mapfilename'][location] + '.json.gz'\n        //console.log(filename_map)\n        //console.log(ext_datafiles['rel_path'] + filename_map)\n        readJSONgz_fun(ext_datafiles['rel_path'] + filename_map, function() {\n          var data = JSON.parse(pako.inflate(this.response, {\n            to: 'string'\n          }));\n          //console.log('Mapfile read:')\n          //console.log(data)\n          if (data['data']['x'].length &lt; 1) {\n            //Map is empty\n          } else {\n            // Map is provided\n            mpoly.data_source.data = data['data']\n            // Show the right date in the title\n            var day = new Date(data['data']['latestDate'][0] / 1e6);\n            const date_format_options = {\n              year: 'numeric',\n              month: 'short',\n              day: 'numeric',\n              timeZone: 'UTC'\n            };\n            const date_format_options2 = {\n              weekday: 'long',\n              timeZone: 'UTC'\n            };\n            // Including UTC as the timezone is important\n            var day_str = day.toLocaleDateString(\"en-US\", date_format_options) + \", \" + day.toLocaleDateString(\"en-US\", date_format_options2)\n            p_map.title.text = day_str;\n\n            mpoly.data_source.change.emit()\n\n            if (location == 'US') {\n              if (button_continental_us_only.active) {\n                button_continental_us_only.active = false;\n                button_continental_us_only.active = true;\n              }\n            }\n          }\n        })\n      }\n    }\n    break;\n\n\n  case 'date_range_slider':\n    var start_date = new Date(date_range_slider.value[0])\n    var end_date = new Date(date_range_slider.value[1])\n    var day = start_date;\n    span_play_position.location = day.getTime();\n\n    switch (radioGroup_play_controls.active) {\n      case play_controls.step:\n        radioGroup_play_controls.active = play_controls.pause;\n        break;\n      case play_controls.play:\n      case play_controls.pause:\n        break;\n    }\n\n    // No break from date_range_slider, directly into radioGroup_play_controls\n    case 'radioGroup_play_controls':\n      switch (radioGroup_play_controls.active) {\n        case play_controls.pause:\n          date_range_slider.disabled = false;\n          break;\n        case play_controls.step:\n        case play_controls.play:\n          date_range_slider.disabled = true;\n          var start_date = new Date(date_range_slider.value[0])\n          var end_date = new Date(date_range_slider.value[1])\n          var day = start_date;\n\n          var date_format_options = {\n            year: 'numeric',\n            month: 'short',\n            day: 'numeric',\n            timeZone: 'UTC'\n          };\n          var date_format_options2 = {\n            weekday: 'long',\n            timeZone: 'UTC'\n          };\n          // Including UTC as the timezone is important\n          var day_str = day.toLocaleDateString(\"en-US\", date_format_options) + \", \" + day.toLocaleDateString(\"en-US\", date_format_options2)\n\n          var next_day = new Date(day)\n          next_day.setDate(next_day.getDate() + 1)\n\n\n          // Find all locations on the map\n          var locations = mpoly.data_source.data['location']\n          var cnt = 0\n          var t0 = performance.now()\n          // Load data for each location, and update the map with the data for the given date\n          for (const [n, loc] of locations.entries()) {\n            readJSONgz_fun(ext_datafiles['rel_path'] + ext_datafiles['location_to_filename'][loc] + '.json.gz', function() {\n              var data = JSON.parse(pako.inflate(this.response, {\n                to: 'string'\n              }));\n              data['data'] = rep_nan_code(data['data'], data['nan_code'])\n              data['data'] = correct_date_format(data['data'])\n\n              const sel_date = find_in_sorted_array(day.getTime(), data['data']['date'])\n\n              // Update the map data with the data for the selected date\n              for (const k in mpoly.data_source.data) {\n                if (k in data['data']) {\n                  mpoly.data_source.data[k][n] = data['data'][k][sel_date['index']]\n                }\n              }\n\n              cnt += 1\n              if (cnt &gt;= locations.length) {\n                // Finished updating map, set map title\n                p_map.title.text = day_str;\n                mpoly.data_source.change.emit()\n\n                // Finish up step and ready for next, when minimum time elapsed\n                var dt = performance.now() - t0\n                setTimeout(function() {\n                  // Update DateRangeSlider and play controls\n                  if (next_day.getTime() &gt; end_date.getTime()) {\n                    date_range_slider.value = [end_date.getTime(), end_date.getTime()];\n                    radioGroup_play_controls.active = play_controls.pause;\n                  } else {\n                    date_range_slider.value = [next_day.getTime(), end_date.getTime()];\n                  }\n                  date_range_slider.change.emit()\n\n                  switch (radioGroup_play_controls.active) {\n                    case play_controls.step:\n                      // if stepping, then goto pause which will trigger enabling the DateRangeSlider\n                      radioGroup_play_controls = play_controls.pause;\n                      break;\n                  }\n                }, spinner_minStepTime.value*1000 - dt);\n              }\n            }, 10000)\n          }\n          break;\n      }\n      break;\n}\n\n\n// ----------------------------------------\n// Support Functions:\n// ----------------------------------------\n\n\n// Find nearest value and index\nfunction find_in_sorted_array(x, sorted_array) {\n  var i = 0;\n  while (x &gt; sorted_array[i] &amp; i &lt; sorted_array.length - 1) {\n    i += 1\n  }\n  return {\n    'value': sorted_array[i],\n    ' ,\nif (cb_data.source.selected.indices.length &gt; 0) {\n  var ind = cb_data.source.selected.indices[0]\n  var location = cb_data.source.data['location'][ind]\n  var location_name = cb_data.source.data['name'][ind]\n  var filename_data = ext_datafiles['rel_path'] + ext_datafiles['location_to_filename'][location] + '.json.gz'\n  var filename_map = ext_datafiles['rel_path'] + ext_datafiles['location_to_filename'][location] + '_map.json.gz'\n  // console.log(location)\n\n  // Read the data file and Update\n  readJSONgz_fun(filename_data, function() {\n    var from_datafile = JSON.parse(pako.inflate(this.response, {\n      to: 'string'\n    }));\n    // console.log('Datafile read: ' + location + ' at ' + filename_data)\n    from_datafile['data'] = rep_nan_code(from_datafile['data'], from_datafile['nan_code'])\n    from_datafile['data'] = correct_date_format(from_datafile['data'])\n    for (var i = 0; i &lt; p_graph_glyphs.length; i++) {\n      p_graph_glyphs[i].data_source.data = from_datafile['data'] //DS_worlds_COVID[state_name].data\n      p_graph_glyphs[i].data_source.change.emit();\n    }\n  })\n\n  // Update title\n  p_graph.title.text = location_name + \": COVID data time history\" //   (Tap a state on the map above to show the corresponding data here)\"\n}\n\n// ----------------------------------------\n// Support Functions:\n// ----------------------------------------\n\n// Replace nan with nan_code in a dictionary of arrays\nfunction rep_nan_code(dic, nan_code) {\n  var inds\n  for (var key in dic) {\n    if (Array.isArray(dic[key])) {\n      dic[key] = array_element_replace(dic[key], nan_code, NaN)\n    }\n  }\n  return dic;\n}\n\n// Replace old_value with new_value in an array\nfunction array_element_replace(arr, old_value, new_value) {\n  for (var i = 0; i &lt; arr.length; i++) {\n    if (Array.isArray(arr[i])) {\n      if (arr[i].length &gt; 1) {\n        arr[i] = array_element_replace(arr[i], old_value, new_value)\n      } else {\n        if (arr[i] === old_value) {\n          arr[i] = new_value;\n        }\n      }\n    } else {\n      if (arr[i] === old_value) {\n        arr[i] = new_value;\n      }\n    }\n  }\n  return arr;\n}\n\nfunction correct_date_format(dic, key = 'date') {\n  const mul = 1e-6\n  dic[key] = dic[key].map(function(a) {\n    return a * mul;\n  })\n  return dic\n}\n\n// Reading gzip json data\nfunction readJSONgz_fun(file, fun_onload, timeout = 2000) {\n  // Based on https://developer.mozilla.org/en-US/docs/Web/API/XMLHttpRequest/Synchronous_and_Asynchronous_Requests\n  var data;\n  var request = new XMLHttpRequest();\n  request.responseType = 'arraybuffer';\n  request.ontimeout = function() {\n    console.error(\"The request for \" + file + \" timed out.\");\n  };\n  request.timeout = timeout;\n  request.onload = fun_onload;\n  request.open('GET', file);\n  request.send();\n\n\n  return request;\n}\n"},"id":"1137","type":"CustomJS"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","top_units":"screen"},"id":"1030","type":"BoxAnnotation"},{"attributes":{"end":1603012724895.638,"start":1592471924895.497},"id":"1079","type":"Range1d"},{"attributes":{},"id":"1140","type":"BasicTicker"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","top_units":"screen"},"id":"1031","type":"BoxAnnotation"},{"attributes":{"callback":null,"formatters":{"$name":"printf","@date":"datetime"},"renderers":[{"id":"1045"},{"id":"1050"},{"id":"1055"}],"tooltips":[["","$name: @$name{0,0.} on @date{%a-%b-%d}"]]},"id":"1082","type":"HoverTool"},{"attributes":{},"id":"1147","type":"UnionRenderers"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","
